Here is a basic Rust app that uses the `reqwest` crate to make API requests to elevenlabs.io and the `tts` crate to read the contents of the clipboard aloud using text-to-speech.

First, add the following dependencies to your `Cargo.toml` file:
```toml
[dependencies]
reqwest = "0.11.10"
tts = "0.1.0"
clipboard = "0.5.0"
```
Next, create a new file called `main.rs` and add the following code:
```rust
use reqwest;
use tts::{TTS, Voice};
use clipboard::{ClipboardContext, ClipboardEvent};

const ELEVENLABS_API_KEY: &str = "YOUR_API_KEY_HERE";
const ELEVENLABS_API_URL: &str = "https://api.elevenlabs.io/v1/text-to-speech";

#[tokio::main]
async fn main() -> Result<(), reqwest::Error> {
    // Initialize the clipboard context
    let mut clipboard = ClipboardContext::new().unwrap();

    // Set up the TTS voice
    let voice = Voice::new("en-US", "female");

    // Set up the API client
    let client = reqwest::Client::new();

    // Listen for clipboard events
    clipboard.add_listener(move |event| {
        if let ClipboardEvent::ClipboardChanged = event {
            // Get the current clipboard contents
            let text = clipboard.get_contents().unwrap();

            // Make an API request to elevenlabs.io to generate TTS audio
            let response = client
                .post(ELEVENLABS_API_URL)
                .header("Authorization", format!("Bearer {}", ELEVENLABS_API_KEY))
                .json(&serde_json::json!({
                    "text": text,
                    "voice": voice.name(),
                }))
                .send()
                .await
                .unwrap();

            // Check if the response was successful
            if response.status().is_success() {
                // Get the audio data from the response
                let audio_data = response.bytes().await.unwrap();

                // Play the audio using the TTS voice
                voice.play(audio_data).unwrap();
            } else {
                eprintln!("Error: {}", response.status());
            }
        }
    });

    // Run the clipboard listener indefinitely
    loop {
        std::thread::sleep(std::time::Duration::from_millis(100));
    }
}
```
This code sets up a clipboard listener that listens for changes to the clipboard contents. When the clipboard contents change, it makes an API request to elevenlabs.io to generate TTS audio for the new clipboard contents. It then plays the audio using the `tts` crate.

Note that you'll need to replace `YOUR_API_KEY_HERE` with your actual elevenlabs.io API key.

