**User Input in TypeScript**
=====================================

In TypeScript, a statically typed language, user input is typically handled using the `prompt()` function or a library like `readline`. Here's an example of how to handle user input in TypeScript:

**Using `prompt()`**
--------------------

```typescript
// Get user input using prompt()
const userInput = prompt("Please enter your name: ");

// Print the user input
console.log(`Hello, ${userInput}!`);
```

**Using `readline`**
--------------------

First, install the `readline` package using npm or yarn:

```bash
npm install readline
```

Then, use the `readline` module to get user input:

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (answer) => {
  console.log(`Hello, ${answer}!`);
  rl.close();
});
```

