There are several ways to style a React app. Here are some popular approaches:

1. **Inline Styles**: You can add styles directly to your JSX elements using the `style` attribute.
```jsx
<div style={{ backgroundColor: 'blue', color: 'white' }}>Hello World!</div>
```
2. **CSS Classes**: You can define CSS classes in a separate stylesheet and apply them to your JSX elements using the `className` attribute.
```css
/* styles.css */
.blue-text {
  background-color: blue;
  color: white;
}
```

```jsx
import React from 'react';
import './styles.css';

function App() {
  return <div className="blue-text">Hello World!</div>;
}
```
3. **CSS-in-JS**: This approach involves writing CSS code in your JavaScript files using a library like **Styled Components**, **Emotion**, or **Glamorous**.
```jsx
import styled from 'styled-components';

const BlueText = styled.div`
  background-color: blue;
  color: white;
`;

function App() {
  return <BlueText>Hello World!</BlueText>;
}
```
